$(document).ready(function(){jQuery.validator.addMethod("notEqual",function(n,t,i){return this.optional(t)||n!==i&&n!==$(i).val()},"Please specify a different (non-default) value");jQuery.validator.addMethod("passwordCheck",function(n,t){if(this.optional(t))return!0;if(/[A-Z]/.test(n))if(/[a-z]/.test(n)){if(!/[0-9]/.test(n))return!1}else return!1;else return!1;return!0},"");jQuery.validator.addMethod("populated",function(n,t,i){return i===!0&&t.childElementCount>0?!0:!1},"");jQuery.validator.addMethod("filesize",function(n,t,i){return this.optional(t)||t.files[0].size<=i},"");jQuery.validator.addMethod("extension",function(n,t,i){return i=typeof i=="string"?i.replace(/,/g,"|"):"png|jpe?g|gif",this.optional(t)||n.match(new RegExp(".("+i+")$","i"))},"")});